def Plot3DTriSurf(points):
    fig = plt.figure()
    ax = fig.gca(projection='3d')
    x = []
    y = []
    z = []
    
    for coord in points:
        x.append(coord[0])
        y.append(coord[1])
        z.append(coord[2] * 3)
        
        
    ax.plot_trisurf(x, y, z, linewidth=0.2)
    plt.show()
    
#Plot3DTriSurf(elevationPoints)

def Plot3DSurface(points):
    Xs, Ys, Zs = [], [], []
    
    for i in points:
        Xs.append(i[0])
        Ys.append(i[1])
        Zs.append(i[2])
    
    fig = plt.figure()
    ax = fig.add_subplot(111, projection='3d')
    
    surf = ax.plot_trisurf(Xs, Ys, Zs, cmap=cm.jet, linewidth=0)
    fig.colorbar(surf)
    
    ax.xaxis.set_major_locator(MaxNLocator(5))
    ax.yaxis.set_major_locator(MaxNLocator(6))
    ax.zaxis.set_major_locator(MaxNLocator(5))
    
    fig.tight_layout()
            
    plt.show()
    
def Plot3DSurfaceWithPatch(points):
    Xs, Ys, Zs = [], [], []
    
    for i in points:
        Xs.append(i[0])
        Ys.append(i[1])
        Zs.append(i[2])
    
    fig = plt.figure()
    ax = fig.add_subplot(111, projection='3d')
    
    surf = ax.plot_trisurf(Xs, Ys, Zs, cmap=cm.jet, linewidth=0)
    fig.colorbar(surf)
    
    p = Circle((Xs[0], Ys[0]), 100)
    ax.add_patch(p)
    art3d.pathpatch_2d_to_3d(p, z=Zs[0], zdir="z")
    
    ax.xaxis.set_major_locator(MaxNLocator(5))
    ax.yaxis.set_major_locator(MaxNLocator(6))
    ax.zaxis.set_major_locator(MaxNLocator(5))
    
    fig.tight_layout()
            
    plt.show()    
    
def Plot3DScatter(points):
    fig = plt.figure()
    ax = fig.add_subplot(111, projection='3d')
    
    for coord in points:
        ax.scatter(coord[0], coord[1], coord[2])
        
    plt.show()

