def getElevationGoogle(lat, long):
    url = "https://maps.googleapis.com/maps/api/elevation/json?locations={},{}&key=AIzaSyB17tcw5haqOWbFiG19jlCjNnH9naYWnVE".format(lat, long)
    r = requests.get(url)
    elevation = r.json()['results'][0]['elevation']
    return elevation
    
