def getElevationGoogleBox(lat1, long1, lat2, long2, rows, cols):
    incrementX = abs((lat1-lat2)/cols)
    incrementY = abs((long1-long2)/rows)
    
    x = lat1
    y = long1
    
    points = []
              
    for i in range(rows):
        for j in range(cols):
            points.append((x, y, getElevationGoogle(x, y)))
            y = y - incrementY
        
        x = x - incrementX
        y = long1
    
    #Plot3DScatter(points)
    return points
    
